import "./Items.css";
import { useNavigate } from "react-router-dom";
import SingleItemList from "./SingleItemList";
export default function Items({
  items,
  addToCart,
  isLogged,
  userIdLogged,
  fetchAgain,
  handleDeleteItem,
  setNavigateItem,
  searchItemsArray,
}) {
  const navigate = useNavigate();
  function handleAddItems() {
    navigate("/addItem");
  }
  const noSearchResults = searchItemsArray.length === 0;
  return (
    <>
      <section id="items">
        <div className="items">
          {/* if the length is bigger than 0 then we searched for something */}
          {searchItemsArray &&
            searchItemsArray.length > 0 &&
            searchItemsArray.map((value, key) => (
              <SingleItemList
                value={value}
                addToCart={addToCart}
                key={key}
                isLogged={isLogged}
                userIdLogged={userIdLogged}
                fetchAgain={fetchAgain}
                handleDeletion={handleDeleteItem}
                setNavigateItem={setNavigateItem}
              />
            ))}
          {/* if the length is 0 we dont search anything -> show the default items */}
          {noSearchResults &&
            items.map((value, key) => (
              <SingleItemList
                value={value}
                addToCart={addToCart}
                key={key}
                isLogged={isLogged}
                userIdLogged={userIdLogged}
                fetchAgain={fetchAgain}
                handleDeletion={handleDeleteItem}
                setNavigateItem={setNavigateItem}
              />
            ))}

          {noSearchResults && <p>No items to show!</p>}
        </div>
      </section>
      {isLogged && (
        <button className="btn-add-items" onClick={handleAddItems}>
          Add items
        </button>
      )}
    </>
  );
}
